import React from "react";
import { useEffect } from "react";
import AccountStyle from "../../styles/Account/Account.css";
import { useSelector } from "react-redux";
import Button from '@mui/joy/Button';
import SideBarComp from "../global/SideBar";
import LogoComp from "../global/Logo";


const { NameAccount, ContainerImgAndAbout, ContainerTextAbout, ContainerAccount, ContainerImg, AboutMe, ContainerAbout, ContainerListTags, ItemTags } = AccountStyle

function Account() {

    const UserData = useSelector(state => state.TypeAuth.user)

    useEffect(() => console.log(UserData))

    return (
        <ContainerAccount>
            <LogoComp></LogoComp>
            <SideBarComp></SideBarComp>
            <ContainerAbout>
                <ContainerImgAndAbout>
                    <ContainerImg>
                        <img src={require('../../imgs/IMG_0039.heic')} alt="" />
                    </ContainerImg>
                    <ContainerTextAbout>
                        <NameAccount>Александр Клоунов</NameAccount>
                        <AboutMe>Lorem ipsum dolor sit amet consectetur adipisicing elit. Dignissimos, iste ipsam. Sit fugit iure sed provident perspiciatis eos a accusamus, aspernatur eius ipsam quaerat ratione adipisci. Labore, quam! Voluptate, eum.</AboutMe>
                    </ContainerTextAbout>
                </ContainerImgAndAbout>
                <ContainerListTags className="list-reset">
                    <ItemTags>123</ItemTags>
                    <ItemTags>1232333</ItemTags>
                    <ItemTags>12asd3</ItemTags>
                    <ItemTags>123</ItemTags>
                    <ItemTags>1q23</ItemTags>
                    <ItemTags>1243</ItemTags>
                </ContainerListTags>
            </ContainerAbout>
            <Button style={{ backgroundColor: "#000074" }} onClick={function () { }}>Изменить</Button>
        </ContainerAccount>
    )
}

export default Account
